import React from "react";
import Billing from "./Billing";
import Payment from "./Payment";
function Checkout() {
  return (
    <div className="container mt20">
      <div className="row">
        <div className="col-md-4 order-md-2">
          <Payment />
        </div>
        <div className="col-md-8 order-md-1">
          <Billing />
        </div>
      </div>
    </div>
  );
}

export default Checkout;
